import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import 'bootstrap/dist/css/bootstrap.min.css';
import {Provider} from 'react-redux';
import store from "./store";
import * as serviceWorker from './serviceWorker';
import "./PersonelScreens/style.css";

import Sidebar from "./PersonelScreens/sidebar";
import {MuiPickersUtilsProvider} from "@material-ui/pickers";

{/*
    Here the reactDOM element and its definition by Id "root" that given in html tag in index.html .
    This <App> component containts whole parts of programm.
*/
}
ReactDOM.render(
    <Provider store={store} id="App">
                <App store={store} id="page-wrap" />
            <Sidebar pageWrapId={"page-wrap"} outerContainerId={"page-wrap"}/>
    </Provider>

    , document.getElementById("root"))
serviceWorker.register();
